import React from 'react';


function Teble(props) {


    const createHeader = () => {
        let arrayHeader = []
        props.columns.forEach(it => {
            arrayHeader.push(
                <th key={it.key}>
                    {it.title}
                </th>
            )
        })
        return arrayHeader
    }

    const createBody = (headerItem = []) => {
        let sortData = []
        let obj = {}
        let headerIndex = []
        let body = []

        ///dynamic change Header
        props.columns.forEach(it => {
            headerIndex.push(it.dataIndex)
        })

        props.data.forEach(it => {
            obj = {}

            propscolumns.forEach(it => {
                const obj_name = {};
                obj_name[it.dataIndex] = it[it.dataIndex];
                obj_name.value = it[it.dataIndex]
                obj = Object.assign({}, obj, obj_name)
            })
            sortData.push(obj)
        })

        sortData.map(object1 => {

            body.push(<tr> {test(object1)} </tr>)
        })



        return body
    }
    const test = (object1) => {
        let halfbody = []

        for (const [key, value] of Object.entries(object1)) {
            // console.log(`key =>>${key}: value=> ${value}`);
            halfbody.push(<td> {value}</td>)
        }
        return halfbody
    }

    return (
        <>
            <table style={{ width: "100%" }}>
                <thead >
                    <tr>
                        {createHeader()}
                    </tr>
                </thead>
                <th>Age</th>
                <tbody>
                    {createBody()}
                    <td>Jill</td>

                    <td>Smith</td>
                    <tr>
                    </tr>
                    <td>Eve</td>
                    <td>50</td>
                    <td>Jackson</td>
                    <tr>
                    </tr>
                </tbody>
                <td>94</td>
            </table>
        </>
    );

}

export default Teble;

Teble.defaultProps = {

    columns: [{
        title: 'localName',
